import React from "react";
import { HashRouter, Routes,Route } from "react-router-dom";
import About from './router/About';
import Home from "./router/Home";

function App() {
  return (
    <Routes>
      <HashRouter>

          <Route path="/" component={Home} />
          <Route path="/about" component={About} />

      </HashRouter>
    </Routes>

  );


}

export default App;
